import styled from 'styled-components'
import { FlatList } from 'react-native'


export const Container = styled.div`
    background-color: #e4e4e4;
`;


export const Title = styled.label`
    background-color: #C4170C;
    width: 100%;
    font-weight: bold;
    text-align: center;
    margin-top: 10px;
    padding: 10px 0px;
    font-size: 20px;
    color: #fff;
    line-height: 21px;
    font-family: opensans,helvetica,arial,sans-serif;
`;

export const ContainerNoticia = styled.div`
    margin-top: 15px;
    margin: 10px;
    font-size: 18px;
    font-family: opensans,helvetica,arial,sans-serif;
    font-weight: bold;
    
`
export const NoticiaPrincipal = styled.div`
    margin-top: 20px;
    
    div {
        background-color: #fff;
        width: 100%;
        color: #C4170C;
        padding: 10px;
    }

    img {
        width: 100%;
        height: 200px;
    }

`
export const NoticiaSecundaria = styled.div`

    label: {
        font-size: 32px;
    }

    img {
        width: 100%;
        height: 200px;
    }

`
export const NoticiaTerciaria = styled.div`
   

    label: {
        font-size: 32px;
    }

    img {
        width: 100%;
        height: 200px;
    }

`
